import classNames from 'classnames/bind';
import styles from './Menu.module.scss';
const cx = classNames.bind(styles);

function MenuItems({ data }) {
    return (
        <div className={cx('item')}>
            {data.icon}
            <span>{data.title}</span>
        </div>
    );
}

export default MenuItems;
